import React from "react";
import { Grid, Paper } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import logo from "../../images/logo.jpeg";

const classes = makeStyles({
	wrapper: {
		display: grid,
		height: "50px",
		color: "50px"
	}
});

const Header = props => {
	return (
		<React.Fragment>
			<Grid container>
				<img src={logo} item />
				<span>Post Job</span>
				<span>Find Job</span>
				<span>Log In</span>
				<span>Sign Up</span>
			</Grid>
		</React.Fragment>
	);
};

export default Header;
